import React from 'react';
import ReactDOM from 'react-dom';
import {Link, Router, Route, IndexRoute} from 'react-router';
import './App.css';
import AboutMeetup from './organisms/AboutMeetup';
import Footer from './organisms/Footer';
import MeetupNow from './organisms/MeetupNow';
import Members from './organisms/Members';
import Navbar from './organisms/Navbar';
import NextMeetup from './organisms/NextMeetup';
import PastMeetups from './organisms/PastMeetups';
import CreateMeetup from './pages/CreateMeetup';
import Explore from './pages/Explore';

const App = () => {
	return (
		<div className='w-full bg-white text-black'>
			<Navbar />
			<MeetupNow />
			<NextMeetup />
			<AboutMeetup />
			<Members />
			<PastMeetups />
			<Footer />
		</div>
	);
}

ReactDOM.render(
	<Router>
		<Route path="/" component={App}>
			<Route path="./pages/CreateMeetup" component={CreateMeetup}></Route>
			<Route path="./pages/Explore" component={Explore}></Route>
		</Route>
	</Router>,
	document.getElementById('container')
);

export default App;
